    "2016-05-27T02:32:46.529855",nt"name": "gold-bullion-repositories",nt"isopen":
    false,nt"url": null,nt"notes": "This dataset contains privately and publicly
    owned bullion repositories. The privately owned repositories are included because
    they are members of the Industry Council for Tangible Assets (ICTA) as listed by
    the ICTA website and therefore deal with gold bullion or are the administrative
    headquarters of the bullion repository. Public locations are included based on the
    value (in US dollars) of the bullion stored, according to the United States Department
    of Treasury. Federal Reserve entities other than the one included in this database
    are excluded because the monetary amount of gold bullion, if any, stored at each
    location could not be determined, and per the United States Department of Treasury,
    the collective amount of the bullion stored among the remaining 11 Federal Reserve
    Banks and among the 25 Federal Reserve Branches (if any) is valued at less than
    one million US dollars. There are entities within this dataset that are also included
    in the HSIP Gold Federal Reserve layer or the HSIP Gold US Mint and Bureau of Engraving
    layer as the entities are considered to be a bullion repository as well as a Federal
    Reserve or a US Mint. The currentness of this dataset is indicated by the [CONTDATE]
    attribute. The oldest record dates from 07/19/2006 and the newest record dates from
    07/24/2006. Due to the sensitive nature of these entities, TGS did not make contact
    with most of the entities within the database. For those entities not contacted
    by TGS, their existence and locations were determined based upon publicly available
    information and research conducted between 6/1/2006 and 7/31/2006.",nt"license_title":
